window.bookSummaryJSON = "<p>Onboard the <i>Anna</i>, Amanda suspects that something fishy is going on. But when her investigation of the peculiar all-female Russian crew fails to uncover anything other than more speculation, she decides it's time to stop playing detective and face her real problem - a man she shouldn't want but can't live without. </p><p>Will Amanda find a way to reconcile her feelings for Dalhu? Will Dalhu find a way to redeem himself in Amanda's eyes? Will Andrew find Bhathian's long-lost lover and child? </p><p>Amanda and Dalhu's story culminates in <i>Dark Enemy Redeemed</i>, and the characters embark on a new adventure in Book 7: <i>Dark Warrior Enthralled</i>. </p>"; 
